import { Trans } from '@lingui/macro'
import { merge } from 'lodash-es'
import React from 'react'
import { DndBlockItem } from '../../../types'
import { styleToCss } from '../../../utils'
import Image from '../../components/Image'
import Text from '../../components/Text'

export default {
    id: 'twoImages',
    label: <Trans>Two Images</Trans>,
    render: (renderProps) => {
        if (!renderProps.item) {
            return null
        }
        const state = renderProps.state.entities[renderProps.item.id].values
        return (
            <>
                <div style={state.item.style}>{Image.render(renderProps, 'image-1')}</div>
                <div style={state.item.style}>{Image.render(renderProps, 'image-2')}</div>
            </>
        )
    },
    export: (renderProps) => {
        if (!renderProps.item) {
            return null
        }
        const state = renderProps.state.entities[renderProps.item.id].values
        return `
            <div style="${styleToCss(state.item.style)}">
                ${Image.render(renderProps, 'image-1')}
            </div>
            <div style="${styleToCss(state.item.style)}">
                ${Image.render(renderProps, 'image-2')}
            </div>
        `
    },
    image:
        'data:image/png;base64,',
    initialValues: {
        item: {
            style: {
                flex: 1,
                padding: '4px 4px 4px 4px',
                alignItems: 'inherit',
                justifyContent: 'inherit',
                display: 'flex'
            }
        },
        'image-1': merge({}, Image.initialValues),
        'image-2': merge({}, Image.initialValues)
    },
    parent: 'image',
    settings: [
        {
            id: 'image-1',
            label: <Trans>Image - 1</Trans>,
            type: 'image',
            settings: Image.settings
        },
        {
            id: 'image-2',
            label: <Trans>Image - 2</Trans>,
            type: 'image',
            settings: Image.settings
        }
    ],
    type: 'block'
} as DndBlockItem
